import React from 'react';
import { Box, Button } from '@material-ui/core'
import "./App.css";

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Box component="span" m={1}>
          <Button color="primary">Press me</Button>
        </Box>
      </div>
    );
  }
}

export default App;
